            loggedin:true,uname:"Amrutha"
        }
    }
    render(){
        return(
            <div>
                {
                    <form>
                    username<input typr="text"/>
                    password<input type="password"/>
                    <button onClick={this.state.loggedin}><Dash>Login</Dash></button>
                </form>
                }
                
            </div>
        )
    }
}
